import React from 'react';
import styled from 'styled-components';

const FooterContainer = styled.footer`
    background-color: #007bff;
    padding: 20px;
    color: white;
    text-align: center;
    position: fixed;
    bottom: 0;
    width: 100%;
`;

const Footer = () => {
    return (
        <FooterContainer>
            <p>&copy; 2024 Audio Participation. All rights reserved.</p>
        </FooterContainer>
    );
};

export default Footer;
